description:
This is a one of a kind. Great in a cabin,log home and Bed $ Breakfast. Truly a nice western look. All handfelted and needle punched. Has a matching piping. Back is black felt. Three black vintage buttons on the top. A leather label
Double D Ranch. Three buttons also accent the front. The pillow measures 15&#8221; x 14&#8221;.
A really nice pillow&#8230;
